import React from "react";
import AppBar from "@mui/material/AppBar";
import PhoneEnabledIcon from "@mui/icons-material/PhoneEnabled";
import Toolbar from "@mui/material/Toolbar";
import { SiteLogo, NavLinks } from "./styles/Navbar.styled";
import { Btn } from "../../styles/general/General.styled";

const Navbar = () => {
  return (
    <AppBar
      position="relative"
      sx={{
        bgcolor: "#a1887f"
      }}>
      <Toolbar>
        <PhoneEnabledIcon sx={{ mr: 1, fontSize: 35 }} />
        <SiteLogo>One Call Away</SiteLogo>
        <NavLinks>
          <Btn>Features</Btn>
          <Btn>Get Chrome Extension</Btn>
          <Btn>Login</Btn>
        </NavLinks>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
